@realDonaldTrump No, Trump, you deluded fool! I won the election - because I say so! You didn't even win the round of golf you played by yourself!

Welcome to the real world! No more White House! Boo hoo! Kick! Rage! Stamp feet!

Now you're history no-one gives a flying duck about you! Bye! 🤣 🤣
